import React from "react";

function Table(props) {
  return (
    <div>
      <table>
  <tr>
    <th>Name</th>
    <th>Email</th>
    <th>Phone</th>
    <th>Dep</th>
  </tr>
  <tr>
    <td>February</td>
    <td>$80</td>
  </tr>
</table>
    </div>
  );
}

export default Table;
